  false,\n\t\"url\": null,\n\t\"notes\": \"This Environmental Assessment is an analysis
  of five alternatives developed to address themanagement of the submerged aquatic
  plants of Banks Lake on Banks Lake National WildlifeRefuge, located in Lanier County,
  Georgia. This section includes a brief background descriptionof the refuge mission
  and objectives, a summary of the legal context within which managementoptions must
  be developed, a discussion of the need and purpose of aquatic plant managementwithin
  Banks Lake, and a description of the planning process used to determine the appropriatemanagement
  strategies. Lastly, the identification of issues and concerns expressed by the public,refuge
  staff, and other agencies with regard to future management and use of Banks Lake
  issummarized and major impact topics are identified and defined.\",\n\t\"license_title\":
